SET NOCOUNT ON;

USE master;
GO

/*Create SourceDB Database*/
 IF NOT EXISTS (SELECT * FROM sys.databases WHERE name = 'SourceDB')
    BEGIN
        CREATE DATABASE SourceDB;
    END
GO

USE SourceDB
GO

IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[Employees]'))
BEGIN

CREATE TABLE [dbo].[Employees] (
    EmployeeID INT,
    FirstName NVARCHAR(50) NOT NULL,
    LastName NVARCHAR(50) NOT NULL,
    Department NVARCHAR(50) NOT NULL,
    Salary DECIMAL(18, 2) NOT NULL,
	CONSTRAINT PK_Employees_EmployeeID PRIMARY KEY (EmployeeID)
);

END

GO

USE SourceDB
GO

/*Feed Intial Data*/
IF NOT EXISTS(select 1 from [dbo].[Employees])
BEGIN


END

GO

